	add("amelia", "{\"term\":\"amelia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Proto-Germanic\"], \"text\":\"A variant of Amalia, derived from Proto-germanic compound names beginning with *\u0027amal\u0027, \u0026quot;vigor, bravery\u0026quot;. The name and its variants have been confused with the Latin name \u0027Aemilia\u0027, Emilia, Emily.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1776\u0027\u0027 Adam Fitz-Adam, \u0027The World of Adam Fitz-Adam\u0027, Edinburgh, Apollo Press 1776: Numb. 187. Thursday, July 29, 1756\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"By their dresses, their names, and the airs of quality they give themselves, I am rendered ridiculous among all my acquaintance. My wife, who is a very plain good woman, and whose name is Amey, has been new-christened, and is called \u0027\u0027Amelia\u0027\u0027; and my little daughter, a child of a year old, is no longer Polly, but Maria\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027 w:Carol Carol Fenner, \u0027Saving Amelia Earhart\u0027,The Third Coast: Contemporary Michigan Fiction, ISBN 0814316956 page 66\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We must have heard it first on the battery radio, the news about \u0027\u0027Amelia\u0027\u0027 Earhart, lost over the ocean. - - - Air Heart, I saw it spelled, \u0027\u0027Amelia\u0027\u0027 ... a name like a soft, bold bird\", \"priority\":4}]}, \"synonyms\":{}}");

