	add("amendment", "{\"term\":\"amendment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from \u0027lang\u003dla\u0027 \u0026lt;!-- Webster 1913 --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An alteration or change for the better; correction of a fault or of faults; reformation of life by quitting vices\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In public bodies; Any alteration made or proposed to be made in a bill or motion that adds, changes, substitutes, or omits\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Ian Black, \u0026quot;[http://www.theguardian.com/world/2014/nov/27/-sp-courts-jordan-crush-support-isis Courts kept busy as Jordan works to crush support for Isis]\u0026quot;, \u0027The Guardian\u0027, 27 November 2014\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Arrests and prosecutions intensified after Isis captured Mosul in June, but the groundwork had been laid by an earlier \u0027\u0027amendment\u0027\u0027 to Jordan’s anti-terrorism law. It is estimated that 2,000 Jordanians have fought and 250 of them have died in Syria – making them the third largest Arab contingent in Isis after Saudi Arabians and Tunisians\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Correction of an error in a writ or process\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An addition to and/or alteration to the Constitution\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The First \u0027\u0027Amendment\u0027\u0027 guarantees freedom of religion, speech, press, assembly, and petition\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Thirteenth \u0027\u0027Amendment\u0027\u0027 to the United States Constitution abolished slavery\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That which is added; that which is used to increase or supplement something\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"a soil \u0027\u0027amendment\", \"priority\":10}]}, \"synonyms\":{}}");

	add("amends", "{\"term\":\"amends\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027amendes\u0027 plural of \u0027amende\u0027 Compare with \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Compensation for a loss or injury; recompense; reparation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Amends\u0027\u0027 were made for the damage and no charges were filed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As to you, Mr. Carruthers, I think that you have done what you could to make \u0027\u0027amends\u0027\u0027 for your share in an evil plot.\u0027 \u0026amp;mdash; Doyle\u0026lt;!-- some material copied from Webster\u0027s Revised Unabridged Dictionary (1913) --\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("amenity", "{\"term\":\"amenity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027aménité\u0027 from Latin {{m|la|amoenitās||pleasantness, delightfulness}}, from \u0027amoenus\u0027 (pleasant, delightful) of unknown origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Pleasantness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We especially enjoyed the \u0027\u0027amenity\u0027\u0027 of the climate on our last holiday\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A thing or circumstance that is welcome and makes life a little easier or more pleasant\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"All the little \u0027\u0027amenities\u0027\u0027 the hotel provided made our stay very enjoyable\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Convenience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"a unit pertaining to the infrastructure of a community, such as a public toilet, a postbox, a library etc\", \"priority\":6}]}, \"synonyms\":{}}");

