	add("amentia", "{\"term\":\"amentia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|āmentia||madness; senselessness}}, from {{m|la|āmēns||mad, insane; foolish}}, from \u0027ab\u0027 (from, away from) + {{m|la|mēns||mind}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mental impairment; state of being mentally handicapped\", \"priority\":1}]}, \"synonyms\":{}}");

	add("america", "{\"term\":\"america\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From a Latinized form of the Italian forename of {{w|Amerigo Vespucci}} (1454–1512). For more, see the Latin entry {{m|la|America}} and the Wikipedia article {{w|America. Etymology_and_naming|on the etymology of \u0027America\u0027}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The continents of North North and South America, especially when considered to form a single continent; the Americas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027 (Penguin 2010), page 691\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Franciscan attitudes in the Canaries offered possible precedents for what Europe now came to call ‘the New World’, or, through a somewhat tangled chain of circumstances, ‘\u0027\u0027America\u0027\u0027’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The United States of America\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIn \u0027\u0027America\u0027\u0027 alone, people spent $170 billion on “direct marketing”—junk mail of both the physical and electronic varieties—last year. Yet of those who received unsolicited adverts through the post, only 3% bought anything as a result\", \"priority\":5}]}, \"synonyms\":{}}");

	add("american", "{\"term\":\"american\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{suffix|America|an|lang\u003den}}, or via Modified Latin \u0027Americanus\u0027 (Latin {{l|la|americanus}}) with the same etymology.File:BrigettaBarrettLondon2012.jpg|thumb|right|{{w|Brigitta Barrett}}, an American silver medalist at the {{w|2012 London Olympics}}, carrying an American flag.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Originally, a native or inhabitant of the British North American colonies of European descent; now, a person born in, or a citizen or inhabitant of, the United States of America\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Chris Moss, \u0027The Guardian\u0027, 9 Aug 2008\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They say \u0027\u0027Americans\u0027\u0027 don\u0027t walk. Well, they do in the Navajo Nation - because even if northern Arizona has gigabytes of photogenic vistas, getting out of the car is the only way to get your boots covered in desert dust and soak up the silence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An indigenous inhabitant of the Americas; an American Indian. (Now chiefly with qualifying word\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1711\u0027\u0027, \u0027The Spectator\u0027, 56.1\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Americans\u0027\u0027 believe that all creatures have souls\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, ‘Mon Père, ce héros’, \u0027Literary Review\u0027, 402\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Within a few months the ‘slave Alexandre’ had been successfully transformed into what, across the Channel, was called a ‘blackamoor dandy’. Parisians preferred the more politely euphemistic term ‘\u0027\u0027American\u0027\u0027’\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An inhabitant of the Americas. More often this is specified as either \u0027North American\u0027, \u0027Central American\u0027 or \u0027South American\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Every \u0027\u0027American\u0027\u0027s origin is, historically speaking, by immigration, if scientific speculation that points to a human origin in Asia and a migration to the New World over frozen Bering Strait turns out to be correct\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A size of type smaller than German, 1-point type\", \"priority\":11}]}, \"synonyms\":{}}");

	add("americana", "{\"term\":\"americana\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|America|ana|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All things peculiar to the United States\u0027 culture and people, anything that is a symbol of American life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An amalgam of roots musics formed by the confluence of the shared and varied traditions that make up the American musical ethos; specifically those sounds that are merged from folk, country, blues, rhythm and blues, rock and roll and other external influential styles\", \"priority\":2}]}, \"synonyms\":{}}");

