	add("americophobia", "{\"term\":\"americophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|Americo|phobia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fear of the United States of America and/or its culture\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027: [Henry] James\u0027s internalised \u0027\u0027Americophobia\u0027\u0027 led him to sound rather like Shaw\u0027s Professor Higgins as he lamented the indifference of the American people to the beauties of their language. \u0026amp;mdash; \u0027Transatlantic Manners: Social Patterns in Nineteenth-Century Anglo-American Travel Literature\u0027, Mulvey, Christopher, Cambridge University Press, p133\", \"priority\":2}]}, \"synonyms\":{}}");

	add("amerikkka", "{\"term\":\"amerikkka\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|America|KKK|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The United States of America\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"in \u0027Broadside\u0027, Volumes 88-129,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003djA4mAQAAIAAJ ]\u0026lt;/sup\u0026gt; page 106\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lead to an inevitable rise of fascism at home. Now that the U.S. is spreading the aggression in Indo-China the danger is coming icily close. The Black Panthers believe this is already a Fascist \u0027\u0027Amerikkka\u0027\u0027; we can understand this view from the black ghetto. We happen to hold that many Americans will resist, and there may be a Civil War in which thousands, if not millions, will die. Feeling thus, it is hard to get enthused about cleaning up the Hudson. There is a strong suspicion that w:Earth Earth Day was a diversion, for at that very moment plans were being put in operation in Washington to spread death and destruction to Cambodia\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, w:Ice Ice Cube\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"AmeriKKKa\u0027\u0027’s Most Wanted\u0027 (album name\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"it\u0027s so obscene and \u0027\u0027Amerikkka\u0027\u0027 and greedy, but pleasing to the eye\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Marcyliena H. Morgan, \u0027The real hiphop: battling for knowledge, power, and respect\u0027, page 161\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Ben Caldwell recalls the scene as follows\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Life as we know it is about to change\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I smell it within the air the weather is getting strange\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Drugged up sedated and numb from the pain\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The sickness in \u0027\u0027Amerikkka\u0027\u0027 has spread to her brain\", \"priority\":12}]}, \"synonyms\":{}}");

